/* Audio visualization test */

const canvas = document.getElementById('canvas');
canvas.width = 1025;
canvas.height = 500;
const ctx = canvas.getContext('2d');

let audioSource;
let analyser;

/*alt + z*/
const audio_button = document.getElementById('button');
let audio = new Audio('data:audio/x-mp3;base64,');



audio_button.addEventListener('click', function () {

	const audioContext = new AudioContext();
	console.log(audioContext);

	audio.play();
	audio.addEventListener('playing', function () {
		console.log('Audio started playing')
	});

	audioSource = audioContext.createMediaElementSource(audio);
	analyser = audioContext.createAnalyser();
	audioSource.connect(analyser);
	analyser.connect(audioContext.destination);
	analyser.fftSize = 2048; //default is 2048 and could go up to 32768
	const bufferLength = analyser.frequencyBinCount;
	const dataArray = new Uint8Array(bufferLength);

	const barWidth = canvas.width / bufferLength;
	let barHeight;
	let x;

	function animate() {
		x = 0;
		ctx.clearRect(0, 0, canvas.width, canvas.height);
		analyser.getByteFrequencyData(dataArray);

		for (let i = 0; i < bufferLength; i++) {
			barHeight = dataArray[i] * 2;
			ctx.fillStyle = 'white';
			ctx.fillRect(x, canvas.height - barHeight, barWidth, barHeight);
			x += barWidth;
		}

		requestAnimationFrame(animate);
	}
	animate();

	audio.addEventListener('ended', function () {
		console.log('Audio ended')
	});
});

